import React from "react";

const Home = () => {
  return (
    <>
      <section id="header" className="">
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 max-auto">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order order-lg-1 ">
                <h1>
                  Grow your business with <span> Snehal Bagde </span>{" "}
                </h1>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
